import React, { useState, useEffect } from 'react';
import {
  ImageSourcePropType,
  ImageResizeMode,
  ViewStyle,
  StyleProp,
} from 'react-native';
import FastImage from 'react-native-fast-image';

type ImageProps = {
  style?: StyleProp<ViewStyle>;
  source?: ImageSourcePropType;
  resizeMode: ImageResizeMode;
};
export function Image_(params: ImageProps) {
  //   let [isError, setIsError] = useState(false);
  let [url, setUri] = useState(params.source.uri);
  useEffect(() => {
    setUri(params.source.uri);
  }, [params.source.uri]);
  return (
    <FastImage
      onError={e => {
        // setIsError(true);
        setUri(
          'data:image/png;base64,',
        );
      }}
      source={{
        uri: url,
        priority: FastImage.priority.high,
      }}
      style={params.style}
      resizeMode={FastImage.resizeMode[params.resizeMode]}
    />
  );
}
